import { Component } from 'react';
import Room from './Room';

export default class Rooms extends Component {

    constructor(props){
        super(props);

        this.state={
            rooms:[]
        };
    }
    componentDidMount(){
        fetch("http://localhost:8000/getUsers")
        .then(res => res.json)
        .then(
            (result) =>{
                this.setState({
                    rooms:result
                })
            }
        )
        
    }
    render() {

    //     const rooms = [{ subj: 'cn101', name: 'Jack Weerachai' }, 
    //                     { subj: 'sf210', name: 'Paul Supakit' }, 
    //                     { subj: 'sf220', name: 'Ajarn Piya' },
    // ]
   
        return (
                <div className="row" >
                    <h1>{this.state.rooms}</h1>
                    {this.state.rooms.map(room => {
                        return (
                            <Room
                                subj={room.subj}
                                name={room.name}
                            >
                            </Room>
                        )
                    })}
                </div>
        )
    }
}
